// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Snapshot.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "../interfaces/IWHITELIST.sol"; 
import "../interfaces/ITOKENHOLDINGS.sol"; 
import "../interfaces/ISELLER.sol"; 
import "../interfaces/IDIVIDENDS.sol"; 
import "../interfaces/IEVENTSAGGREGATOR.sol"; 

interface IMANAGERWL {
    function whiteList() external view returns(address); 
}

contract TokenHoldings is ITOKENHOLDINGS, ERC20, ERC20Snapshot, Pausable, Ownable {
    //////////////////////////////////////////////////////////////////////////////////////////////////
    // State
    //////////////////////////////////////////////////////////////////////////////////////////////////

    address private s_manager;
    address private s_contractSeller;
    address private s_contractDividends;

    mapping(uint256 => SnapshotInfo[]) private s_idsSnapshots;
    uint256[] private s_yearsSnapshots;
    mapping(uint256 => bool) private s_years; 
    mapping(address => mapping(uint256 => bool)) private snpashotsUsed;

    uint256 private s_amountBuyWithFiat;
    mapping(address => uint256) private s_amountBuyWithFiatUser;

    address private s_eventsaggregator;

    //////////////////////////////////////////////////////////////////////////////////////////////////
    // Constructor
    //////////////////////////////////////////////////////////////////////////////////////////////////

    constructor(
        string memory p_name, 
        string memory p_symbol,
        address p_manager,
        address p_contractSeller,
        address p_contractDividends,
        uint256 p_amount,
        address p_eventsaggregator
    ) ERC20(p_name, p_symbol) {
        s_manager = p_manager;
        s_contractSeller = p_contractSeller;
        s_contractDividends = p_contractDividends;

        _transferOwnership(p_manager);

        s_eventsaggregator = p_eventsaggregator;

        _mint(p_contractSeller, p_amount);
    }

    //////////////////////////////////////////////////////////////////////////////////////////////////
    // Public functions
    ////////////////////////////////////////////////////////////////////////////////////////////////// 

    // => View functions

    function seller() public view override returns(address) {
        return s_contractSeller;
    }

    function getCurrentSnapshotId() public view override returns(uint256) {
        return _getCurrentSnapshotId();
    }

    function snapshotsYear(uint256 p_year) public view override returns(SnapshotInfo[] memory) {
        return s_idsSnapshots[p_year];
    }

    function yearsWithSnapshots() public view override returns(uint256[] memory) {
        return s_yearsSnapshots;
    }

    function amountBuyWithFiat() public view override returns(uint256) {
        return s_amountBuyWithFiat;
    }

    function amountBuyWithFiatUser(address p_buyer) public view override returns(uint256) {
        return s_amountBuyWithFiatUser[p_buyer]; 
    }

    function snapshotUsed(address p_account, uint256 p_snapshotId) public view override returns(bool) {
        return snpashotsUsed[p_account][p_snapshotId];
    }

    // => Set functions

    function setPause(bool p_pause) public onlyOwner override {
        if (p_pause) {
            _pause();
        } else {
            _unpause();
        }
    } 

    function snapshotUse(address p_account, uint256 p_snapshotId) public override returns(bool) {
        require(msg.sender == s_contractDividends, "Error origin");

        snpashotsUsed[p_account][p_snapshotId] = true;

        return true;
    }

    function snapshot(uint256 p_year, bool p_withholding) public override returns(uint256) { 
        require(msg.sender == s_contractDividends, "Error origin");

        uint256 id = _snapshot();

        s_idsSnapshots[p_year].push(SnapshotInfo(id, p_withholding));
        if (!s_years[p_year]) {
            s_yearsSnapshots.push(p_year);
            s_years[p_year] = true; 
        }

        return id;
    }

    function incrementAmountBuyWithFiat(uint256 p_amount, address p_buyer) public override returns(bool) { 
        require(msg.sender == s_contractSeller, "Error origin");

        s_amountBuyWithFiat += p_amount; 
        s_amountBuyWithFiatUser[p_buyer] += p_amount;

        return true;
    }

    function forcedTransferStocks(address p_from, address p_to) public onlyOwner override returns(bool) {
        _transfer(
            p_from,
            p_to,
            balanceOf(p_from)
        );

        emit ForcedTransferStocks(p_from, p_to);

        return true;  
    }

    //////////////////////////////////////////////////////////////////////////////////////////////////
    // Internal functions
    //////////////////////////////////////////////////////////////////////////////////////////////////

    function _beforeTokenTransfer(address from, address to, uint256 amount)
        internal
        whenNotPaused
        override(ERC20, ERC20Snapshot)
    {
        ISELLER sellerContract = ISELLER(s_contractSeller);

        if (
            from != address(0) && 
            from != s_contractSeller && 
            to != address(0) &&
            to != s_contractSeller
        ) {
            require(sellerContract.canTransferHoldings(), "Contract seller reverte the transfer"); 
        }

        IWHITELIST.Status statusToWL = IWHITELIST(IMANAGERWL(s_manager).whiteList()).status(to); 
        require(
            statusToWL == IWHITELIST.Status.Active ||
            from == address(0) ||
            (to == address(0) || to == s_contractSeller), 
            "To account not active"
        );

        if (s_amountBuyWithFiatUser[to] > 0) {
            require(from == s_contractSeller || from == address(0), "Error destination, wallet by company");
        }

        if (s_amountBuyWithFiatUser[from] > 0) {
            require(to == s_contractSeller || to == address(0), "Error origin, wallet by company");
        }

        IEVENTSAGGREGATOR(s_eventsaggregator).transferEvent(address(this), from, to, amount);

        super._beforeTokenTransfer(from, to, amount); 
    }
}
